def longest_common_subsequence(s1, s2):
    m = len(s1)
    n = len(s2)

    # Create a table to store lengths of LCS of substrings
    dp = [[0] * (n + 1) for _ in range(m + 1)]

    # Fill the table in bottom-up manner
    for i in range(m + 1):
        for j in range(n + 1):
            if i == 0 or j == 0:
                dp[i][j] = 0
            elif s1[i - 1] == s2[j - 1]:
                dp[i][j] = dp[i - 1][j - 1] + 1
            else:
                dp[i][j] = max(dp[i - 1][j], dp[i][j - 1])

    # Read the table from bottom-up to construct the LCS
    result = []
    i, j = m, n
    while i > 0 and j > 0:
        if s1[i - 1] == s2[j - 1]:
            result.append(s1[i - 1])
            i -= 1
            j -= 1
        elif dp[i - 1][j] > dp[i][j - 1]:
            i -= 1
        else:
            j -= 1

    # Return the LCS in the correct order
    return ''.join(reversed(result))


